import React from 'react';

class App extends React.Component {
  constructor(props) {
    super (props)

    this.State = { lat: null }

    window.navigator.geolocation.getCurrentPosition(
      position => {
        this.setState = ({ lat: position.coords.lat })
      },
      err => console.log(err)
    )

  }
  render() {
    return (
      <div>latitude:{this.state.lat}</div>
    )
  }
}
export default App
